const slides = [
    document.querySelector(".slide1"),
    document.querySelector(".slide2"),
    document.querySelector(".slide3"),
    document.querySelector(".slide4"),
    document.querySelector(".slide5")
];



let current_middle = 2, prev_target = 2;

for(let i = 0; i < 5; i++){
    slides[i].style.order = i;
}

let cat_index = 0;
let left_cat_index = 0, right_cat_index = 4;
let swap_bool = false;

for(let i = 0; i < 5; i++){


    slides[i].onmouseover = (e) =>{
        
        if((current_middle - 2 + 5) % 5 === i || (current_middle + 2) % 5 === i)
            swap_bool = true;
        else
            swap_bool = false;
        setTimeout(() =>{
            
            if((current_middle - 2 + 5) % 5 === i){
                for(let j = 0; j < 5; j++){
                    slides[j].style.order = parseInt(slides[j].style.order) + 1; 
                }

                (function(){
                    imageInsideParent = slides[(i+4) % 5].querySelector('img');
                    left_cat_index = (left_cat_index - 1 + cats.length) % cats.length;
                    right_cat_index = (right_cat_index - 1 + cats.length) % cats.length;
                    imageInsideParent.src = cats[left_cat_index].src;
                })();
                
                slides[((current_middle + 2) % 5)].style.order = "0";
                current_middle = (current_middle - 1 + 5) % 5;
            }

            if((current_middle + 2) % 5 === i){

                for(let j = 0; j < 5; j++){
                    slides[j].style.order = parseInt(slides[j].style.order) - 1; 
                }

                (function(){
                    imageInsideParent = slides[(i+1) % 5].querySelector('img');
                    left_cat_index = (left_cat_index + 1 + cats.length) % cats.length;
                    right_cat_index = (right_cat_index + 1 + cats.length) % cats.length;
                    imageInsideParent.src = cats[right_cat_index].src;
                })();
                
                slides[((current_middle - 2 + 5) % 5)].style.order = "5";
                current_middle = (current_middle + 1) % 5;
            }

            

            let slide1 = current_middle - 2;
            let slide2 = current_middle - 1;
            let slide4 = current_middle + 1;
            let slide5 = current_middle + 2; 
            
            (function(prev_target){
                slides[prev_target].style.width = "20%";
                slides[prev_target].style.height = "50%";

                slides[(slide1 + 5) % 5].style.width = "0%";
                slides[slide5 % 5].style.width = "0%";
            })(prev_target)

            prev_target = i;

            if(i === (slide2 + 5) % 5)
                slides[(slide1 + 5) % 5].style.width = "20%";

            if(i === slide4 % 5)
                slides[slide5 % 5].style.width = "20%";
                    
            slides[i].style.width = "30%";
            slides[i].style.height = "100%";

            
        }, swap_bool ? 250 : 0);
        
    };
    
    
    
};

